import { Container, styled, Typography } from "@mui/material";

const ContainerFeed = styled(Container)(({theme}) => ({
    backgroundColor: 'yellow'
}));

const Feed = () => {
    return (
        <ContainerFeed>
            <Typography> Feed </Typography>
        </ContainerFeed>
    );
};

export default Feed;
